// ApiService.js

class ApiService {
    static async getTopGainersAndLosers() {
      const apiKey = 'JH59KR1EHBJDXW6T'; // Replace 'YOUR_API_KEY' with your actual API key
      const url = `https://www.alphavantage.co/query?function=TOP_GAINERS_LOSERS&apikey=${apiKey}`;

      try {
        const response = await fetch(url);
        const data = await response.json();

        // Assuming the response contains 'gainers' and 'losers' arrays
        const gainers = data["gainers"];
        const losers = data["losers"];

        return { gainers, losers };
      } catch (error) {
        throw new Error('Error fetching top gainers and losers:', error);
      }
    }
  }

  export default ApiService;
